import "./AuctionPlayer.css";
import Image1 from "../../assets/productItemImage1.jpeg";
import Image2 from "../../assets/productItemImage2.png";
import Image3 from "../../assets/productitemImage3.png";
import Image4 from "../../assets/productItemImage4.png";

const AuctionPlayer = () => {
  return (
    <div>
      <div className="product_header bid_header">
        <div className="bid_header_lot">
          <h5>Lot:</h5>
          <p>12345678</p>
        </div>
        <h4 className="car_name">2014 - BMW 3er Touring:</h4>
        <h4 className="upcomming_lots">Upcoming Lots</h4>
      </div>
      <div className="product_info_image">
          <div className="product_info_images">
            <div
              className="product_info_main_img div__Image"
            ></div>
            <img src={Image1} alt="productimage" />
            <img src={Image2} alt="productimage" />
            <img src={Image3} alt="productimage" />
            <div style={{ position: "relative" }}>
              <div className="product_image_fone">
                <p>+7 photos</p>
              </div>
              <img
                src={Image4}
                alt="productimage"
                width="100%"
                height={"100%"}
              />
            </div>

          </div>
        </div>
    </div>
  );
};

export default AuctionPlayer;
